const Table = () => {
  const data = [
    { time: 1, day: "one" },
    { time: 2, day: "two" },
    { time: 3, day: "three" },
    { time: 4, day: "four" },
  ]

  return (
    <div>
      <table>
        <tbody>
          {data.map((el) => {
            return (
              <tr key={el.day}>
                <td>{el.time}</td>
              </tr>
            )
          })}
        </tbody>
      </table>
    </div>
  )
}

export default Table
